(NULL, 1504, 'Ms', 'Michael', 'Luna', 'Ibrahim', '1950-04-18', 'M', '0406 926 470', '384 Oxford Ave, Hobart, Hobart, TAS, 7000', 'michael.ibrahim1504@example.com', 'Jacob Ibrahim', '0450 914 256', 'Michael Ibrahim currently resides in the state of TAS and attends the clinic for ongoing care. The patient is a community-dwelling individual who presents for a routine review of their ongoing health concerns and management plan. They describe a gradual onset of fatigue over the past few months, with intermittent headaches and disturbed sleep. There is a background history of mild asthma and seasonal allergies, with occasional use of inhalers during periods of respiratory infection or high pollen exposure. The patient denies recent hospital admissions, surgery or major trauma. They report sporadic adherence to prescribed medications and admit that work and family demands often make it difficult to maintain a regular exercise routine or balanced diet. Current symptoms include low energy, variable appetite and intermittent musculoskeletal discomfort affecting the neck, shoulders and lower back after prolonged sitting. They also describe episodes of mild shortness of breath on exertion, particularly when climbing stairs or rushing for public transport, but no associated chest pain or palpitations. Sleep is frequently non-restorative, with difficulty initiating sleep and early-morning waking on several nights each week. The patient is motivated to improve their overall wellbeing and is open to lifestyle modification, review of medications and further investigations to clarify any underlying contributors to their symptoms and to develop a collaborative, sustainable management plan tailored to their daily routine and personal goals.'),
